import React from 'react';

const Header = () => {
	return (
		<div className='ttu'>
			<h1 className='f4 pa2 w-80 center'>My name is <span style={{color: 'red'}} className='f1 '>Kyle Chart</span>,</h1>
			<h1 className='fl w-60'>And I am a Fullstack Developer.</h1>
		</div>
	);
}

export default Header;
